import './output.css';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import ChipsArray from './routes/Chip';

function App() {
  return (
    <div className='w-screen h-screen font-halvetica bg-app-bg'>
      <BrowserRouter>
        <Routes>
          <Route
            path='/checkout'
            element=<Checkout />
          />
          <Route
            path='/payments'
            element=<Payments />
          />
          <Route
            path='/orderconfirmation'
            element=<OrderConfirmation />
          />

          <Route
            path='*'
            element=<Navigate to='/chip' />
          />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
